import React, {FC, PropsWithChildren} from 'react';

import s from "./styles/FormError.module.scss";

export const FormError: FC<PropsWithChildren> = (props) => {
    const {children,...other} = props;

    return (
        <p
            className={s.formError}
            {...other}
        >{children}</p>
    );
};
